resources.description:
Получение GUID ПЕРВОЙ компании в поиске (я могу искать и GUID всех если нужно), возвращает json с поисковым запросом и guid компании, а так же сохраняет эту информацию в базу и сохраняет всю информацию о компании в базу


Пример запроса:
{
	"company_name": "реал"
}

Пример ответа
[
  {
    "searchText": "реал",
    "company_guid": "a82731ea-291d-4cc2-a11c-763f3a6dd421"
  }
]
